import React from "react";
import "./Navbar.css";
import logo from "../assets/logo.png";

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="Left">
        <img src={logo} alt="Osumare Logo" className="logo-img" />
      </div>

      <div className="Right">
        <button className="contact-button">Con</button>
      </div>
    </nav>
  );
};

export default Navbar;
